import * as React from "react";
import styled from "styled-components";

// interface CategorieProps {
//   categoryPk: number;
//   categoryName: string;
//   categoryCode: string;
// }
export default function CategoryTab(item: any) {
  console.log(item.item.categoryName, "123");
  return <Button>{item.item.categoryName}</Button>;
}

const ButtonGroup = styled.ul`
  padding: 5px;
`;
const Button = styled.li`
  margin-left: 2px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  background: #ffffff;
  padding: 12px 16px;
  border: 1px solid #e8e8e8;
  border-radius: 20px;
  font-weight: 500;
  font-size: 14px;
  line-height: 14px;
  height: 38px;
  float: left;
  cursor: pointer;
`;
